import React from 'react';

const AdminDashboard = () => {
  return (
    <div style={{maxWidth:900,margin:'40px auto',padding:'2rem',background:'#fff',borderRadius:18,boxShadow:'0 2px 16px #a855f733'}}>
      <h1 style={{color:'#a855f7',fontWeight:800,textAlign:'center',marginBottom:'2rem'}}>Admin Dashboard</h1>
      <div style={{fontSize:'1.15rem',color:'#334155',textAlign:'center'}}>
        ยินดีต้อนรับสู่หน้าแดชบอร์ดผู้ดูแลระบบ<br/>
        (เพิ่มเนื้อหา/เมนู admin ได้ตามต้องการ)
      </div>
    </div>
  );
};

export default AdminDashboard;
